import React,{Component} from 'react';


class Toolbar extends Component{
    render () {
        return (
            <header>
            <div>Child.LK</div>
            <div>Home</div>
            <div>My Cart</div>
            <div>My Orders</div> 
            <div>About Us</div>   
            </header>
        );
    }
}

export default Toolbar;
